import React from "react";


//var
//let
//const


const canvas = (props) => {
  let style = {
    //backgroundColor: `${props.color}`,
    position:"absolute",
    top: `${props.top}px`,
    left: `${props.left}px`,
    width: '100px',
    length: '100px'
  };
  console.log(style)
  return <div style={{
    backgroundColor:"red",
    top:"100px",
    left:"200px"
  }}></div>
  //return <div></div>
}

export default canvas;
